import React from "react";
import { useState } from "react";

function Forminfunc(){
    const[name,setname]=useState(" ")
    const[num,setnum]=useState(" ")
    const[mail,setmail]=useState(" ")
    const[role,setrole]=useState(" ")

    namefun=(event)=>{
        setname(event.target.value)
    }
    numfun=(event)=>{
        setnum(event.target.value)
    }
    mailfun=(event)=>{
        setmail(event.target.mail)
    }
    rolefun=(event)=>{
        setrole(event.target.role)
    }
    submitfun=(event)=>{
        event.preventDefault();
        alert(` name:${name}`)
    }
return(
    <form onSubmit={this.submit}>
            <h1>Fill this form to apply</h1>
            <div id='name'>
            <label>Name:</label>
            <input type="text" value={name} onChange={namefun} />
            </div>
            <div>
                <label >Mobile No:</label>
                <input type="number" value={num} onChange={numfun}></input>
            </div>
            <div>   
                <label>emailid:</label>
                <input type="email" value={mail} onChange={this.mail} />
            </div>
            <div>
                <label>Resume:</label>
                <input type="file"  />
            </div>
            <div>
                <label >Role:</label>
                <select value={role} onChange={this.role}>
                    <option >Frontend </option>
                    <option >Java Backend</option>
                    <option >Python Backend</option>
                    <option >Node.js Backend</option>
                    <option >Database Management</option>
                    <option >Associate</option>
                </select>
            </div>
            <input type="submit" />
        </form>
)
}

export default Forminfunc
